import React, { Component } from "react";
// import './App.css';


class Student extends Component{
    render(){
        return(
            <div>
                <h1>Hello {this.props.name}</h1>
                <h1>Roll No:  {this.props.roll}</h1>
            </div>
        )
    }
   
}

export default Student;
